import './services.css'


const Services = () => {
    return (
        <div>
            {/* <h1>This is the services page</h1> */}
            <div class="service-menu">
                <div class="manicure">
                    <h1>Manicure Services</h1>
                    <p>+ Basic Manicure</p>
                    <p>+ Spa Manicure</p>
                    <p>+ Gel Manicure</p>
                    <p>+ SNS Manicure</p>
                </div>

            </div>
        </div>
    )
}

export default Services;
